import './App.css';
import React, { Component } from 'react'
import Button from "./Components/Button/Button"
 class App extends Component {
  render() {
    return (
      <div className="app">
        <div className="jumbotron">
          <h1>Calculator</h1> 
          <p>Made with React</p>
        </div>

        <Button/>

      </div>
    )
  }
}

export default App;
